import React, { useState, useEffect} from 'react';
import { Redirect } from 'react-router-dom';

function NotFound(props) {

    const [notFound, setNotFound] = useState(<div>Страница не найдена. Вы будете перенаправлены на домашнюю страницу.</div>)



    useEffect(() => {
        setTimeout(()=>setNotFound( <Redirect to={`/`} />), 1000);
    }, []);

    return(
        <>
            
            { notFound} 
        </>
    )
}

export default NotFound
